def agregar_cliente(request):
    if request.method == "POST":
        cliente_form = ClienteForm(request.POST)
        direccion_formset = DireccionFormSet(request.POST)

        if cliente_form.is_valid() and direccion_formset.is_valid():
            cliente = cliente_form.save()
            direcciones = direccion_formset.save(commit=False)
            for direccion in direcciones:
                direccion.cliente = cliente
                direccion.save()
            return JsonResponse({'success': True, 'message': 'Cliente agregado correctamente'})
        
        # üî• Devolver errores si el formulario no es v√°lido
        errors = {**cliente_form.errors, **direccion_formset.errors}
        return JsonResponse({'success': False, 'errors': errors}, status=400)

    return JsonResponse({'success': False, 'error': 'M√©todo no permitido'}, status=405)
    

def login_view(request):
    if request.method == "POST":
        username = request.POST['username']
        password = request.POST['password']
        user = authenticate(request, username=username, password=password)
        if user is not None:
            login(request, user)
            return redirect('dashboard')  # Redirigir al dashboard si el login es exitoso
        else:
            messages.error(request, "Usuario o contrase√±a incorrectos")
    return render(request, 'usuarios/login.html')

def logout_view(request):
    logout(request)
    return redirect('login')  # Redirigir al login despu√©s de cerrar sesi√≥n

