                cliente.save()

                # Devolver una respuesta JSON con el mensaje de √©xito
                return JsonResponse({
                    "message": "Cliente actualizado correctamente",
                    "id": cliente.id,
                    "estatus": cliente.estatus,  # Devolver el estado actualizado
                }, status=200)
            else:
                # Si el formulario no es v√°lido, devolver los errores
                return JsonResponse({
                    "error": "Error en el formulario",
                    "detalles": form.errors,
                }, status=400)
        except Exception as e:
            # Manejar errores inesperados
            return JsonResponse({
